import './NavBar.scss';
import { Link } from 'react-router-dom';
import { ReactComponent as Logo } from '../../Logo/Logo.svg';

const NavBar = () => {
  return (
    <div className='NavBar'>
        <Link className='logo-link'  to='/'>
          <span className='logo-container'>
            <Logo className='logo' />
          </span>
        </Link>
    </div>
  )
}

export default NavBar;
